'use client'

import { Usable, use, useEffect, useState } from 'react'
import { Box, Typography, Paper, Divider, Button } from '@mui/material'
import { IFormValues } from '@/components/Calculator/Instruction/IFormValues'
import { TStatus } from '@/components/Calculator/Instruction/TStatus'
import Link from 'next/link'
import { toast, ToastContainer } from 'react-toastify'
import 'react-toastify/dist/ReactToastify.css'

export default function SubscriberPage({ params }: { params: { id: string } }) {
  const id = use<{ id: string }>(params as unknown as Usable<{ id: string }>).id

  const [data, setData] = useState<IFormValues | null>(null)

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch(`/api/subscribers/${id}`, {
          method: 'GET',
          headers: { 'Content-Type': 'application/json' }
        })

        if (!response.ok) {
          throw new Error(`Response status: ${response.status}`)
        }

        const jsonData = await response.json()
        setData(jsonData)
      } catch (error) {
        console.error((error as Error).message)
      }
    }

    fetchData()
  }, [id])

  if (!data) {
    return (
      <Box className="flex justify-center items-center h-screen">
        <Typography variant="h6">Ładowanie...</Typography>
      </Box>
    )
  }

  const exportToCSV = () => {
    const csvHeaders = Object.keys(polishLabels).map(
      key => polishLabels[key as keyof typeof polishLabels]
    )
    const csvRow = Object.keys(polishLabels).map(key =>
      mapValueToPolish(data[key as keyof typeof polishLabels])
    )

    const csvContent = [csvHeaders, csvRow]
      .map(row => row.map(value => `"${value ?? ''}"`).join(','))
      .join('\n')
    const blob = new Blob([csvContent], { type: 'text/csv;charset=utf-8;' })
    const url = URL.createObjectURL(blob)
    const link = document.createElement('a')
    link.setAttribute('href', url)
    link.setAttribute('download', `${data.name || 'subscriber'}.csv`)
    link.style.visibility = 'hidden'
    document.body.appendChild(link)
    link.click()
    document.body.removeChild(link)
  }

  const handleDownload = async () => {
    try {
      const response = await fetch(`/api/subscribers/${id}`, {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' }
      })
      if (!response.ok) {
        throw new Error(`Response status: ${response.status}`)
      }
      const blob = await response.blob()
      const url = window.URL.createObjectURL(blob)
      const a = document.createElement('a')
      a.href = url
      a.download = 'subscriber.pdf'
      a.click()
      window.URL.revokeObjectURL(url)
    } catch (error) {
      console.error((error as Error).message)
      toast.error('Błąd przy pobieraniu pliku. Możliwe jest, że użytkownik nie dodał pliku')
    }
  }

  const allowedKeys = [
    'age',
    'gender',
    'weight',
    'height',
    'pressure',
    'isSmoking',
    'cholesterol',
    'name',
    'pesel',
    'dateOfBirth',
    'placeOfBirth',
    'education',
    'foreignOrigin',
    'foreignCountry',
    'nationalMinority',
    'isHomeless',
    'isDisabled',
    'phone',
    'email',
    'voivodeship',
    'district',
    'commune',
    'town',
    'postalCode',
    'houseNumber',
    'localNumber',
    'areaOfResidence',
    'status',
    'shiftChanges'
  ]

  const polishLabels = {
    age: 'Wiek',
    gender: 'Płeć',
    weight: 'Waga',
    height: 'Wzrost',
    pressure: 'Ciśnienie',
    isSmoking: 'Palenie tytoniu',
    cholesterol: 'Cholesterol',
    name: 'Imię',
    pesel: 'PESEL',
    dateOfBirth: 'Data urodzenia',
    placeOfBirth: 'Miejsce urodzenia',
    education: 'Wykształcenie',
    foreignOrigin: 'Obce pochodzenie',
    foreignCountry: 'Obcy kraj zamieszkania',
    nationalMinority: 'Mniejszość narodowa',
    isHomeless: 'Osoba bezdomna',
    isDisabled: 'Osoba niepełnosprawna',
    phone: 'Telefon',
    email: 'Email',
    voivodeship: 'Województwo',
    district: 'Powiat',
    commune: 'Gmina',
    town: 'Miasto',
    postalCode: 'Kod pocztowy',
    houseNumber: 'Numer domu',
    localNumber: 'Numer mieszkania',
    areaOfResidence: 'Obszar zamieszkania',
    status: 'Status',
    shiftChanges: 'Praca zmianowa'
  }

  const mapValueToPolish = (value: string | boolean) => {
    if (value == true || value == 'true') return 'Tak'
    if (value == false || value == 'false') return 'Nie'
    if (value == 'unknown') return 'Odmowa podania danych'
    if (value == 'male') return 'Mężczyzna'
    if (value == 'female') return 'Kobieta'
    if (statusMapping[value as TStatus]) return statusMapping[value as TStatus]
    return value
  }

  const statusMapping: Record<TStatus, string> = {
    selfEmployed: 'Osoba prowadząca działalność na własny rachunek',
    publicGovernmentAdministrationWorker: 'Osoba pracująca w administracji rządowej',
    localGovernmentAdministrationWorker: 'Osoba pracująca w administracji samorządowej',
    nonGovernmentalOrganizationWorker: 'Osoba pracująca w organizacji pozarządowej',
    MSMEWorker: 'Osoba pracująca w MMŚP (mikro, małe, średnie przedsiębiorstwa)',
    largeEnterpriseWorker: 'Osoba pracująca w dużym przedsiębiorstwie',
    medicalActivitiesWorker: 'Osoba pracująca w podmiocie wykonującym działalność leczniczą',
    schoolWorkerTeachingStaff:
      'Osoba pracująca w szkole lub w placówce systemu oświaty (kadra pedagogiczna)',
    schoolWorkerNonTeachingStaff:
      'Osoba pracująca w szkole lub w placówce systemu oświaty (kadra niepedagogiczna)',
    schoolWorkerAdministrationStaff:
      'Osoba pracująca w szkole lub w placówce systemu oświaty (kadra zarządzająca)',
    universityWorker: 'Osoba pracująca na uczelni',
    scientificInstituteWorker: 'Osoba pracująca w instytucie naukowym',
    researchInstituteWorker: 'Osoba pracująca w instytucie badawczym',
    ŁukasiewiczResearchNetworkWorker:
      'Osoba pracująca w instytucie działającym w ramach Sieci Badawczej Łukasiewicz',
    internationalInstituteWorker: 'Osoba pracująca w międzynarodowym instytucie naukowym',
    federationOfHigherEducationAndScienceSystemEntitiesWorker:
      'Osoba pracująca dla federacji podmiotów systemu szkolnictwa wyższego i nauki',
    stateLegalEntityWorker: 'Osoba pracująca na rzecz państwowej osoby prawnej',
    other: 'Inne',
    '': ''
  }

  return (
    <main className="p-6">
      <ToastContainer />
      <Paper className="p-6 max-w-4xl mx-auto">
        <div className="grid grid-cols-3 justify-between items-center ">
          <Button
            href="/subscribers"
            className="self-center w-full"
            variant="contained"
            color="primary"
          >
            <ArrowLeft /> Powrót do listy{' '}
          </Button>
          <Typography variant="h4" className="mb-4 text-center">
            Informacje o uczestniku programu
          </Typography>
          <Link href="/">
            <HospitalIcon />
          </Link>
        </div>
        <Divider className="mb-6" />
        <div className="grid gap-2 grid-cols-3">
          {Object.entries(data)
            .filter(([key]) => allowedKeys.includes(key))
            .map(([key, value], index) => (
              <Box className="p-4 bg-gray-100 rounded-lg shadow-sm" key={index}>
                <Typography variant="subtitle2" className="font-semibold text-gray-700 uppercase">
                  {polishLabels[key as keyof typeof polishLabels] || key}{' '}
                </Typography>
                <Typography variant="body2" className="text-gray-900">
                  {Array.isArray(value)
                    ? value.map(mapValueToPolish).join(', ')
                    : mapValueToPolish(value)}
                </Typography>
              </Box>
            ))}
        </div>
      </Paper>
      <Button
        variant="contained"
        color="primary"
        onClick={exportToCSV}
        sx={{ position: 'fixed', bottom: 20, right: 20 }}
      >
        Exportuj do CSV
      </Button>
      <Button
        variant="contained"
        color="error"
        onClick={() => handleDownload()}
        sx={{ position: 'fixed', bottom: 80, right: 20 }}
      >
        Pobierz PDF użytkownika
      </Button>
    </main>
  )
}

const ArrowLeft = () => (
  <svg
    xmlns="http://www.w3.org/2000/svg"
    height="24"
    viewBox="0 0 24 24"
    width="24"
    className="fill-white"
  >
    <path d="M14 7l-5 5 5 5V7z" />
    <path d="M24 0v24H0V0h24z" fill="none" />
  </svg>
)

const HospitalIcon = () => (
  <svg
    xmlns="http://www.w3.org/2000/svg"
    xmlnsXlink="http://www.w3.org/1999/xlink"
    width="183"
    height="52"
    fill="none"
    viewBox="0 0 183 52"
    className="self-center place-self-center"
    aria-label="ikona szpitala"
  >
    <path fill="url(#pattern0_5558_1566)" d="M0 .359h183v51H0z"></path>
    <defs>
      <pattern id="pattern0_5558_1566" width="1" height="1" patternContentUnits="objectBoundingBox">
        <use xlinkHref="#image0_5558_1566" transform="matrix(.00043 0 0 .00154 0 -.011)"></use>
      </pattern>
      <image
        xlinkHref="data:image/png;base64,"
        id="image0_5558_1566"
        width="2326"
        height="663"
      ></image>
    </defs>
  </svg>
)
